function Random(number) {
    var text = "";
    var possible = "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789";

    for (var i = 0; i < number; i++)
        text += possible.charAt(Math.floor(Math.random() * possible.length));

    return text;
}

var loaderActive = false;
function ShowLoader() {
    loaderActive = true;
    $.LoadingOverlay("show");
    setTimeout(function () {
        if (loaderActive) {
            $.LoadingOverlay("hide");
            NotificationErrorFixed($('#divMessage'), 'It is taking longer than expected, something might have gone wrong or your connection has dropped');
        }
    }, 30000);
}
function HideLoader() {
    loaderActive = false;
    setTimeout(function () {
        $.LoadingOverlay("hide");
    }, 200);
}
function ParseAjax(jsonObj) {
    if (!jsonObj.IsAuthenticated) {
        NotificationSessionTimeout($('#divMessage'));
        return false;
    }
    if (!jsonObj.IsVerified) {
        window.location.replace("/wait");
        return false;
    }
    if (!jsonObj.Success) {
        NotificationErrorFixed($('#divMessage'), jsonObj.Message);
        return false;
    }
    return true;
}
function ParseAjaxNonFixedMsg(jsonObj) {
    if (!jsonObj.IsAuthenticated) {
        NotificationSessionTimeout($('#divMessage'));
        return false;
    }
    if (!jsonObj.IsVerified) {
        window.location.replace("/wait");
        return false;
    }
    if (!jsonObj.Success) {
        NotificationError('', jsonObj.Message);
        return false;
    }
    return true;
}
function createCookie(name, value, days) {
    var expires = "";
    if (days) {
        var date = new Date();
        date.setTime(date.getTime() + (days * 24 * 60 * 60 * 1000));
        expires = "; expires=" + date.toUTCString();
    }
    document.cookie = name + "=" + value + expires + ";domain=.aretosystems.com;path=/";
}
function readCookie(name) {
    var nameEQ = name + "=";
    var ca = document.cookie.split(';');
    for (var i = 0; i < ca.length; i++) {
        var c = ca[i];
        while (c.charAt(0) == ' ') c = c.substring(1, c.length);
        if (c.indexOf(nameEQ) == 0) return c.substring(nameEQ.length, c.length);
    }
    return '';
}
function eraseCookie(name) {
    createCookie(name, "", -1);
}